def solve(s):
    count = 0
    stack = []

    for c in s:
        if c == '(':
            stack.append(c)
        elif c == ')':
            if len(stack) == 0:
                count += 1
            else:
                stack.pop()

    return count + len(stack)

def solve(s):
    stack = []
    swaps = 0
    for char in s:
        if char == '[':
            stack.append(char)
        else:
            if len(stack) > 0:
                stack.pop()
            else:
                swaps += 1
                stack.append('[')

    return swaps + len(stack)//2

